import { Link, Outlet } from 'react-router-dom';

function Breadbord() {
    return (
        <>
        <Outlet />
        <header>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/about">About</Link></li>
                <li><Link to="/video">Video</Link></li>
                <li><Link to="/photos">Photos</Link></li>
            </ul>
        </header>

        

        <footer></footer>
        </>
    )
}

export {Breadbord}
